import React, {useState, useEffect, useReducer} from "react";




export default function Table(props) {
  const [empoloyee, setEmployee] = useState(null);
  
  async function fetchEmployeeData(results) {
    const response = await fetch("https://randomuser.me/api/?results=50");
    setEmployee(await response.json());
    console.log(setEmployee);
  }

  useEffect(() => {
    fetchEmployeeData(props.results);
  },[props.results]);

  if(!empoloyee) {
    return "loading...";
  }


return (
<div>
 <p>{props.results}</p>
</div>
)
}
